@Component({
  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.scss']
})
export class FooterComponent {

}

<footer class="bg-dark text-center text-white">
  <p> Copyright © 2023 by Jolanta Pisulska</p>
</footer>
